import React from "react";
import "./index.css";
import data from "./data.js";
import Review from "./components/Review";
import ReviewSummary from "./components/ReviewSummary";
import { Routes, Route } from "react-router-dom";
import Product from "./components/Product";
import Spin from "./components/Spin";
import Board from "./images/Board.png";
import SignupPage from './pages/Signup';
import LoginPage from './pages/Login';
import HomePage from "./pages/LoginPage";


function App() {
  const reviewData = data.map((item) => {
    return <Review key={item.id} item={item} />;
  });
  return (
    <div>
      <Routes>
        <Route path="/" element={reviewData} />
        <Route
          path="reviewSummary"
          element={
            <ReviewSummary
              rectangle={data[0].rectangle}
              coloredStar={data[0].vector}
              whiteStar={data[0].vector2}
              img={data[0].imgUrl}
            />
          }
        />
        <Route
          path="product"
          element={
            <Product
              img={data[0].rectangle}
              coloredStar={data[0].vector}
              whiteStar={data[0].vector2}
            />
          }
        />

        <Route path="spin" element={<Spin />} />
      </Routes>
      <div className="min-h-full h-screen flex place-center accent-red-700 bg-[url(./images/Board.png)] sm:px-6 lg:px-8">
      <div className="max-w-md w-full  m-0">
          <Routes>
            <Route path="Login" element={<LoginPage/>} />
            <Route path="signup" element={<SignupPage/>} />
            <Route path="HomePage" element={<HomePage/>} />
        </Routes>
    </div>
  </div>
    </div>
  );
}

export default App;
